import React, { Component } from 'react'
import Layout from '../components/Layout';
import Perklevel from '../components/Perklevel';

import '../style/perktree.scss';

export default class perktree extends Component {

    constructor(props) {
        super(props);
    }


    render() {
        return (
            <Layout>
                <div className="perktree-container">
                    <ul className="perk">
                        <li className="perk-level title"><span>Strength</span></li>
                        <Perklevel/>
                    </ul>
                </div>    
            </Layout>
        )
    }
}
